import React, { Component } from 'react';
import './App.css';
import data from './data.json'

class App extends Component{
  render(){
    console.log("data",data);
    var headerStyle ={
      "backgroundColor":"blue",
    }

    return(
      <div>
       <div id="header" style={headerStyle}>
         <h3>Widget Depot</h3>

       </div>
      </div>
    )
  }
}
export default App;
